import axios from "axios";
import React, {useEffect, useState, useMemo} from 'react';


function Home(){
    let group_list = useMemo(() => [...group_list], [])
    const [flag, setFlag] = useState(false)
    //const [groupList, setGroupList] = useState([])
    
    const changeFlag = () =>{
      setFlag(!flag)
    }
  
    useEffect(() => {
      const load_g = async ()=>{
        const res = await axios.get('http://127.0.0.1:8000/api/groups/')
        
        let i = 0
        for (i in res.data){
            group_list.push(res.data[i])
        }
        console.log(group_list)
      }
      load_g()
  
    }, [flag, group_list])

    return(
    <section className="Home">
      <div className="owned-groups">
      {group_list?.map(group =>
        <p key = {group.id-1}> {group.name} {group.description} {group.date_created} {group.owner}</p>
        )}
      </div>
    </section>
      )
  }

  export default Home;
